script: |
  super -f text -I q5780.spq | sort > q5780.out

inputs:
  - name: q5780.spq
    data: |
      SELECT DISTINCT + - ( 84 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q5780.out
    data: |
      -84
